      out.write("\t\t\t<td id=\"zs4\">江西农业大学是一所以农为优势、以生物技术为特色、多学科协调发展的有特色高水平大学；具有博士学位授予权；是我国首批具有学士学位、硕士学位授予权单位之一；是江西省最早开展研究生教育的高校；是农业部与江西省人民政府共建高校，是国家林业局与江西省人民政府共建高校；国家“中西部高校基础能力建设工程”高校。学校位于南昌经济技术开发区，总占地面积1.6万亩。校园风景秀丽，景色宜人。 学校溯源于1905年创办的江西实业学堂，1908年更名为江西高等农业学堂。本科教育肇始于1940年创办的国立中正大学，1949年更名为南昌大学，1952年组建江西农学院。1958年创办江西共产主义劳动大学总校，1968年更名为江西共产主义劳动大学。1969年江西农学院和江西共产主义劳动大学合并。1980年11月更名为江西农业大学。 学校育人体系完备。学科涵盖农、理、工、经、管、文、法、教、哲、艺等10大门类。现设有17个学院，各类全日制在校学生达26000余人（含独立学院）。有3个一级学科博士点，19个一级学科硕士点，68个本科专业。有1个国家林业局重点学科，3个江西省高水平学科，7个省级重点学科。有1个国家二类特色专业，4个国家一类特色专业，9个省级特色专业。有2个博士后科研流动站，1个博士后科研工作站。2014年，招收了江西省第一个外籍博士后。 学校师资力量雄厚。现有在职教职工近1600余人，其中具有博士、硕士学位人员占教师总数的80%以上。有中国科学院院士1人，“国家杰出青年基金”获得者2人，国家“万人计划”领军人才3人，国家中青年科技创新领军人才1人。有全国“五四”奖章获得者2人，国家级有突出贡献中青年专家3人，国家“百千万人才工程”人选5人，“中国青年科技奖”获得者3人，国家现代农业产业技术体系岗位科学家3人，教育部“新世纪优秀人才支持计划”人选4人，“赣鄱英才555工程”人选24人。有“全国杰出专业技术人才先进集体”、教育部“长江学者和创新团队发展计划”</td>\r\n");
