      out.write("\t\t\t<td id=\"zs2\">赣南师范大学位于国家历史文化名城、江西省域副中心城市——赣州市。</td>\r\n");
      out.write("\t\t\t<td id=\"zs3\">school.jpg</td>\r\n");
      out.write("\t\t\t<td id=\"zs4\">赣南师范大学位于国家历史文化名城、江西省域副中心城市——赣州市。学校创办于1958年6月，时为赣南师范专科学校；1984年更名为赣南师范学院，升格为省属本科师范院校；2003年成为硕士学位授予权单位，是赣粤闽湘四省边际区域唯一具有硕士学位授予权的省属本科师范院校。2016年3月，学校经教育部批准更名为赣南师范大学。 学校现有黄金校区、章贡校区、白塔校区（大学科技园）3个校区，占地2200余亩，校舍建筑面积80余万平方米，教学科研仪器设备总值2.2亿余元，图书馆藏书220余万册。设有19个教学学院、1所独立学院和1所附属中学，有涵盖10个学科门类的71个本科专业、9个一级学科硕士点（涵盖62个二级学科硕士点）和5个硕士专业学位授权点。面向全国27个省（区、市）招生，现有全日制在校生19000余人，其中研究生近1200人。 学校现有专任教师近1000人，其中高级专业技术人员430余人，博士教师230余人；近年来引进和培养了一批学科学术领军人才，现有中国工程院双聘院士1人，有国家新世纪百千万人才工程人选、教育部新世纪优秀人才计划人选、国务院特殊津贴专家等20余人，教师队伍的学历结构、职称结构、学缘结构得到明显优化。广大教师爱岗敬业、教书育人，涌现了“全国优秀教师”“全国优秀科技工作者”“全球孔子学院先进个人”“江西省五一劳动奖章”“江西省教育系统师德标兵”等一批先进典型。 学校始终坚持人才培养中心地位，2014年荣获2项国家教学成果奖二等奖和1项全国教育硕士专业学位教学成果奖一等奖，获批2个国家特色专业、2门国家精品课程、3个教育部专业综合改革项目、4个教育部产学合作协同育人项目、1个全国教育硕士专业学位研究生联合培养示范基地，全力打造赣南及周边地区基础教育师资培养培训中心、研究咨询中心和改革发展服务中心，形成了以教师教育和文理学科为特色、文理管工多学科协调发展的办学格局。 学校始终坚持提高质量的办学宗旨，为国家和社会培养输送了近16万名毕业生。近五年，在校学生参加省级以上各类竞赛屡获大奖，其中荣获中宣部“五个一工程”奖、中国戏剧“梅花奖”、国际大学生数学建模竞赛一等奖、全国大学生创业大赛一等奖、全国大学生艺术展演一等奖、全国师范院校师范生教学技能大赛特等奖等竞赛一等奖190余人次；</td>\r\n");
